Disco rígido SAS 600Gb 15k RPM 6Gbps para servidor com as seguintes especificações: 
Compatível com Servidor Dell PowerEdge R720 - Service Tag 997Y0Y1;
Compatível com o controlador RAID H710P Mini;
Capacidade de armazenamento: 600 GB; 
Velocidade de transferência de 6Gb/s; 
Possuir memória cache de, no mínimo, 16 MB; 
Velocidade de rotação de 15000 rpm; 
Taxa anual de falhas menor ou igual a que 0,55 %; 
Máximo de erros de leitura irrecuperáveis por bits lidos: 1 por 10^16;
Latência média de 2 ms, ou inferior; 
Tempo de busca menor ou igual que 8.5 ms(milissegundos); 
Tempo médio de leitura e escrita menor ou igual que 3.9 ms (milissegundos); 
Taxa média de leitura e gravação, (trilha a trilha) deverá ser menor ou igual a 0,4 ms (milissegundos); 
Caso possuir formato de 2,5 polegadas, deverá vir com adaptador para gaveta (Drive Tray) de 3,5 polegadas; 
A garantia do fabricante/fornecedor deverá ser de, no mínimo, 1 ano a contar da data de entrega do produto. 
Observação: os discos precisam ser NOVOS, não serão aceitos discos remanufaturados ou incompatíveis.
